import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../PageTemplate.css';

const Vendors = () => {
  const navigate = useNavigate();

  return (
    <div className="page-template">
      <div className="page-header">
        <button className="back-button" onClick={() => navigate('/')}>
          ‚Üê Back to Home
        </button>
        <h1>Vendors</h1>
      </div>
      <div className="page-content">
        <div className="placeholder-content">
          <h2>üöö Vendor Management</h2>
          <p>Manage supplier relationships and procurement.</p>
          <div className="feature-list">
            <div className="feature-item">‚Ä¢ Vendor directory</div>
            <div className="feature-item">‚Ä¢ Purchase orders</div>
            <div className="feature-item">‚Ä¢ Supplier performance</div>
            <div className="feature-item">‚Ä¢ Contact management</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Vendors;
